import './App.css';
import React from 'react';

function Welcome() {
  return (
        <div class="view" style={{ 
            backgroundImage: "url('https://www.google.com/url?sa=i&url=https%3A%2F%2Fwww.freepik.com%2Ffree-photos-vectors%2Fpet-background&psig=AOvVaw3F8ebKmBqKWUmER2kAUc6E&ust=1635641052018000&source=images&cd=vfe&ved=0CAsQjRxqFwoTCPiOofHz8PMCFQAAAAAdAAAAABAD')",
            backgroundRepeat: 'no-repeat', backgroundSize: "cover", backgroundPosition: "center"}}>
        <div class="mask rgba-black-light align-items-center">
          <div class="container">
            <div class="row">
              <div class="col-md-12 mb-4 white-text text-center">
                <h1 class="h1-reponsive white-text text-uppercase font-weight-bold mb-0 pt-md-5 pt-5 wow fadeInDown" data-wow-delay="0.3s"><strong>PetLand</strong></h1>
                <h5 class="text-uppercase mb-4 white-text wow fadeInDown" data-wow-delay="0.4s"><strong>Photography & design</strong></h5>
                <a href="/login" class="btn btn-outline-white wow fadeInDown" data-wow-delay="0.4s">LOGIN</a>
                <a href="/register" class="btn btn-outline-white wow fadeInDown" data-wow-delay="0.4s">REGISTER</a>
              </div>
            </div>
          </div>
        </div>
      </div>
  );
}

export default Welcome;
